validator-listerrors-description:
Navaja napake (in opozorila), ki so se pojavile v vstavkih razčlenjevalnika, dodanih iz knjižnice Validator.
Navedeni so samo zgoraj dodani vstavki, pri katerih so vstavljene značke »<code>listerrors</code>«;
da pridobite vse napake, postavite »<code>listerrors</code>« na dno ali blizu dna strani.
